import React from "react";


export default class CodeOfConduct extends React.Component {

    render() {
        return (
            <React.Fragment>
                <div className="venue-conatiner">
                    <div className="center-container">
                        <h1>Code of Conduct</h1>
                        <p>All attendees, speakers, sponsors and volunteers at our conference are required to agree with the following code of conduct. Organisers will enforce this code throughout the event. We are expecting cooperation from all participants to help ensure a safe environment for everybody.</p>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
